import React from "react";
import Highcharts from "highcharts";
import HighchartsReact from "highcharts-react-official";

export default function Details() {
  fetch("http://185.50.193.81:5001/api/session/verify", {
    method: "GET",
    headers: {
      Authorization: "Bearer " + cookies.get("sessionKey"),
      "Content-Type": "application/json"
    }
  })
    .then(response => {
      return response.text();
    })
    .then(response => {
      console.log(response);
      if (response.includes("the given key is still valid for another")) {
        console.log("Valid!");
      } else {
        console.log("NOT Valid!");
        window.location.href = "/login";
      }
    });
  return (
    <div className="row">
      <div className="col col-12">
        <h1>Detaljer</h1>
        <div className="card" style={{ overflow: "hidden", width: "50%" }}>
          <div className="card-body">
            <HighchartsReact highcharts={Highcharts} options={options} />
          </div>
        </div>
      </div>
    </div>
  );

  // Chart options
  function getOptions() {
    return (options = {
      chart: {
        type: "column",
        backgroundColor: "#0000"
      },
      title: {
        text: null
      },
      accessibility: {
        announceNewData: {
          enabled: true
        }
      },
      xAxis: {
        type: "category",
        lineColor: "#ccd6eb"
      },
      yAxis: {
        title: {
          text: null
        }
      },
      legend: {
        enabled: false
      },

      series: [
        {
          name: "Watt forbrug",
          borderColor: "#0000",
          color: "#03D9F0",
          data: [
            {
              name: "00",
              y: 62.74
            },
            {
              name: "01",
              y: 10.57
            },
            {
